import '../Pages/All.css'
import React from 'react';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
function Table({ data }) {
    console.log(data);
    return (
        <div>
            <table border={1}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Age</th>
                        <th>Profile</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item) => {
                        return <tr key={item.id}>
                            <td>{item.name}</td>
                            <td>{item.age}</td>
                            <td>{item.profile}</td>
                            <td>
                                <button type="button" className="btn btn-danger me-3">Remove</button>
                                <button type="button" className="btn btn-success">Edit</button>
                            </td>
                        </tr>
                    })}

                </tbody>
            </table>
        </div>
    )
}
export default Table
